import { useState } from 'react';
import styled from "../assets/styles";

interface IProps {
    title: string;
}

export const Input = styled.input`
    /* position: absolute; */
    width: 258px;
    height: 36px;
    margin: 20px 0px;
    background: #FFFFFF;
    border: 1px solid rgba(0, 0, 0, 0.11);
    box-sizing: border-box;
    border-radius: 5px;
`;

export default ({ title }: IProps) => {
    const [value, setValue] = useState('');

    return <Input placeholder={title} value={value} onChange={(e: any) => e.target.value} />
}
